import './componentes/fundo/fundo.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div class="body">

      <div class="esquerda"></div>

      <div class="topo"></div>

      <div class="meio"></div>

      </div>
      </header>
    </div>
  );
}

export default App;
